description:
Qt is a cross-platform application and UI framework for developers using C++ or QML, a CSS &amp; JavaScript like language. Qt Creator is the supporting Qt IDE.

Qt, Qt Quick and the supporting tools are developed as an open source project governed by an inclusive meritocratic model. Qt can be used under open source (LGPL v2.1) or commercial terms.


The binary packages include Qt 5.1.0 libraries and Qt Creator 2.7.2

